var objItems={i0:{name:"Ложный цветочек",img:"./images/items/flower.png",description:"А ты думала, я цветочек??? Не-а. Ложный! Просто игрушка... Вот Ты  - настоящий цветочек"},i1:{name:"Разбитое Борино cердэцко",img:"./images/items/broken-heart.png",description:"Расколотое пополам серде бедного крестьянина, так отчаянно желавшего любви и ласки своей Богини. Во времена смуты лета 2019-ого года после долгих скитаний и сражений в окружении таких же отчаянных тестостеронщиков владельца этого органа хватил горький приход, когда, как гром и молния средь бела дня, прозвучал приговор, такой острый и болючий, как тоненькое лезвие бумаги. А приговор наказывал ему сидеть на попе смирно и с болью продолжать разрывать это отчаянно бьющееся сердце. Но с каждым разом, с каждым новым днём оно разрывалось ещё с большим напором, ведь Богиня его всё ближе и ближе подкрадывалась к лучшему другу. С тех пор на месте одинокого крестьянина остались лишь небольшие отголоски того прошлого и жизнерадостного молодого человека. Теперь там нет ни сердца, ни любви. Врагу не пожелаешь таких друзей, будь тот проклят"},i2:{name:"Солнечные очки",img:"./images/items/glass.png",description:'"Посмотри на это Солнце - оно прекрасно, как весна. Я лишь хочу узреть в глазах его фатоны от луча. И прошу тебя, девчонка, подай очки же неспеша. Я хочу узреть здесь Солнце. Но звезда лишь ты, ха-ха", - хотел пропеть ей скромный парень, жаль, что мал словарь лошары. Всего лишь "эээ... Дай мне очки". Во дебил, блин, посуди'},i3:{name:"Уменьшенная версия коровы",img:"./images/items/cow.png",description:"Ходят легенды, что это и есть та самая брошенная корова, которую никто не решился оседлать. Говорят, всему виной одна барышня, для которой садиться на корову было слишком низко. Вот и передаётся эта уменьшенная коровка из рук в руки, пока не найдёт свою обидчицу и не вернёт должок. Погодите-ка..."},i4:{name:"История Насти и Дани",img:"./images/items/book.png",description:'Том 36. Глава 78. Пятый ребёнок<br><br>Уже пятый день шёл дождь, сопровождавший Трач Анастасию в палате для рожениц. С этого дня её по праву можно было называть "плодородием", ведь в эту ночь на свет появился пятый малыш, новый маленький Данечка. Жаль, что Даниил уже не сможет посмотреть своему сыну в глаза, ведь он пару лет как спился и загрузил своё сознание в Dota 2. Настя устало поглядывала на сыночка и раздумывала над его именем. В голове крутились такие имена, как Ахуй, Гус, Дрюля и Задок, но не одно из них не могло соревноваться с именем "Даня", самым любимым именем героини. Но ведь не называть уже третьего мальчика Даней? И вправду, глупо и необдуманно. Поэтому она решила после выписки поехать к знакомой знахарке и отдать последнюю зарплату на то, чтобы та нагадала ей идеальное имя по лунному календарю<br><br>Остальную книгу можешь прочитать на сайте по адресу https://obman.shnajder'},i5:{name:"Кастрюля супа",img:"./images/items/soup.png",description:"Отварное зелье, дающее +100% к выносливости и силе, а также полностью восстанавливающее чувство голода"},i6:{name:"Жёлтая маечка",img:"./images/items/brassiere.png",description:"Тебе точно есть 18??? Нет, не верю. Поэтому что либо писать здесь не намерен! Видишь ли, моду завели развращаться. У парня своего спросишь, что это такое"},i7:{name:"Картина Владу",img:"./images/items/picture.png",description:"Первый набросок, второй, третий, и так за кистью кисть. Любая картина - это муторное сложное занятие, однако, художник наславу постарался. Давно уже стёрлось его имя, поэтому нам не понять, кто конкретно изображён на холсте. Некий парень с девушкой. Может ли быть один из них создателем картины? Может. Допустим, это девушка. Тогда мужчина слева её кавалер, иначе не может быть. Кому как ни молодому человеку расписывать такое полотно? Ну а если это парень, то его девушке очень сильно повезло. Наверное, они счастливая пара. Хочется в это верить, но верится с трудом. Особенно, когда являешь любовником девушки справа ( • )( • )ԅ(≖‿≖ԅ)"},i8:{name:"Рюкзак какой-то деффки",img:"./images/items/backpack.png",description:'Я представлял это так: "Что-что? Коне-е-ечно я тебе верну рюкзак. Когда? А х*й его знает)))". Вот и прошло уже лет 50, а девушка так и не вернула его. Этот рюкзак уже достался её внукам и грядёт кровная вражда между семьями. Внуки и правнуки поджидают друг друга, чтобы устроить кровавую бойню за рюкзак, который давно томится в главном корпусе НАТО, ведь та самая девушка перед своей глубокой старостью позаботилась о скрытности. Жалко, что она не смогла предугадать, что две семьи станут двумя странами-лидерами в экономике и не начнут агитировать народ на вражду между нациями из-за рюкзака. Через ещё сотню лет произойдёт Подольское сражение в парке Талалихина, самое масштабное сражение 22-ого века. Тогда погибнет целая нация Подольчан, а вместе с ней и рецепт производства самой вкусной конфеты "Подольчанка". Это будет самым разрушительным ударом по миру вцелом. Мне не страшно, потому что я уйду из жизни до распада "Подольчанки", а вот внукам моим придётся не сладко. Поэтому, пожалуйста, если ты это читаешь, верни этот чёртов рюкзак той истеричке'},i9:{name:"Утерянный паспорт Украины",img:"./images/items/passport.png",description:'Ти ж мене обдурила. Ти ж мене підвела. Ти ж мене, молодиця, просто кинула лоха<br><br>Ти шепотіла як хохлушка, тепер російська хатинка. І натуру продала. Як і паспорт, ось балда<br><br>Ти ж мене там убила. Ти ж мене і забула. Тільки я повернувся, зай. "Вже не потрібен, йди гуляй"'},i10:{name:"Те самые прокладки",img:"./images/items/pads.png",description:"Самое страшное для парня"},i11:{name:"Бейсбольная бита",img:"./images/items/baseball-bat.png",description:"Наверное, лучшее оружие против плоскотелых"},i12:{name:"Билет в Европу",img:"./images/items/ticked.png",description:"Фамилия: Деволя<br>Имя: Анастасия<br>Отчество: Бродиловна<br><br>Страна прибывания: Европа<br><br>Дата: начало июля<br>Цель визита: захотелось<br><br>P.S. уважаемый пассажир, настоятельно рекомендуем перед отправкой отвешать несколько пинков той девушке. Если же вы уже это сделали, то чего же вы медлите? Отправляемся в путь!"}};export{objItems};